import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [results, setResults] = useState(null);
  const [endpointResults, setEndpointResults] = useState(null);
  const [patternResults, setPatternResults] = useState(null);
  const [filePath, setFilePath] = useState('trace.har');
  const [endpointSortBy, setEndpointSortBy] = useState('requests');
  const [patternSortBy, setPatternSortBy] = useState('requests');

  const analyzeHAR = async () => {
    setLoading(true);
    setError(null);
    setResults(null);
    setEndpointResults(null);
    setPatternResults(null);

    try {
      const response = await axios.post('/api/analyze', {
        file_path: filePath
      });

      if (response.data.success) {
        setResults(response.data.data);
      } else {
        setError(response.data.error || 'Analysis failed');
      }
    } catch (err) {
      setError(err.response?.data?.error || err.message || 'Network error');
    } finally {
      setLoading(false);
    }
  };

  const analyzeEndpoints = async () => {
    setLoading(true);
    setError(null);

    try {
      const response = await axios.get('/api/analytics/endpoints', {
        params: {
          file_path: filePath,
          sort_by: endpointSortBy,
          limit: 20
        }
      });

      if (response.data.success) {
        setEndpointResults(response.data.data);
      } else {
        setError(response.data.error || 'Endpoint analysis failed');
      }
    } catch (err) {
      setError(err.response?.data?.error || err.message || 'Network error');
    } finally {
      setLoading(false);
    }
  };

  const analyzePatterns = async () => {
    setLoading(true);
    setError(null);

    try {
      const response = await axios.get('/api/analytics/patterns', {
        params: {
          file_path: filePath,
          sort_by: patternSortBy,
          limit: 15
        }
      });

      if (response.data.success) {
        setPatternResults(response.data.data);
      } else {
        setError(response.data.error || 'Pattern analysis failed');
      }
    } catch (err) {
      setError(err.response?.data?.error || err.message || 'Network error');
    } finally {
      setLoading(false);
    }
  };

  const StatCard = ({ number, label }) => (
    <div className="stat-card">
      <div className="stat-number">{number}</div>
      <div className="stat-label">{label}</div>
    </div>
  );

  const ResponseCodeItem = ({ code, count }) => (
    <div className="code-item">
      <div className="code-number">{code}</div>
      <div className="code-count">{count} responses</div>
    </div>
  );

  const EndpointItem = ({ url, error_count, status_codes, avg_latency_ms, request_count }) => (
    <li className="endpoint-item">
      <div className="endpoint-url">{url}</div>
      <div className="endpoint-details">
        {error_count && (
          <div>Errors: {error_count} | Status Codes: {status_codes?.join(', ')}</div>
        )}
        {avg_latency_ms && (
          <div>Avg Latency: {avg_latency_ms}ms | Requests: {request_count}</div>
        )}
      </div>
    </li>
  );

  const DetailedEndpointItem = ({ endpoint }) => (
    <li className="endpoint-item" style={{ borderLeft: '4px solid #667eea' }}>
      <div className="endpoint-url">
        <strong>{endpoint.method}</strong> {endpoint.url}
      </div>
      <div className="endpoint-details">
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gap: '0.5rem', marginTop: '0.5rem' }}>
          <div><strong>Total Requests:</strong> {endpoint.total_requests}</div>
          <div><strong>Success Rate:</strong> {endpoint.success_rate}%</div>
          <div><strong>4xx Errors:</strong> {endpoint.error_4xx_count}</div>
          <div><strong>5xx Errors:</strong> {endpoint.error_5xx_count}</div>
          <div><strong>Avg Latency:</strong> {endpoint.avg_latency_ms}ms</div>
          <div><strong>Max Latency:</strong> {endpoint.max_latency_ms}ms</div>
        </div>
        {Object.keys(endpoint.status_codes).length > 0 && (
          <div style={{ marginTop: '0.5rem' }}>
            <strong>Status Codes:</strong> {Object.entries(endpoint.status_codes).map(([code, count]) => `${code}:${count}`).join(', ')}
          </div>
        )}
      </div>
    </li>
  );

  const PatternItem = ({ pattern }) => (
    <li className="endpoint-item" style={{ borderLeft: '4px solid #28a745' }}>
      <div className="endpoint-url">
        <strong>{pattern.method}</strong> {pattern.pattern}
        <span style={{ fontSize: '0.8rem', color: '#666', marginLeft: '1rem' }}>
          ({pattern.unique_paths} unique paths)
        </span>
      </div>
      <div className="endpoint-details">
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(120px, 1fr))', gap: '0.5rem', marginTop: '0.5rem' }}>
          <div><strong>Total Requests:</strong> {pattern.total_requests}</div>
          <div><strong>Success Rate:</strong> {pattern.success_rate}%</div>
          <div><strong>4xx Errors:</strong> {pattern.error_4xx_count}</div>
          <div><strong>5xx Errors:</strong> {pattern.error_5xx_count}</div>
          <div><strong>Avg Latency:</strong> {pattern.avg_latency_ms}ms</div>
          <div><strong>P95 Latency:</strong> {pattern.p95_latency_ms}ms</div>
          <div><strong>P99 Latency:</strong> {pattern.p99_latency_ms}ms</div>
          <div><strong>Min Latency:</strong> {pattern.min_latency_ms}ms</div>
        </div>
        {Object.keys(pattern.status_codes).length > 0 && (
          <div style={{ marginTop: '0.5rem' }}>
            <strong>Status Codes:</strong> {Object.entries(pattern.status_codes).map(([code, count]) => `${code}:${count}`).join(', ')}
          </div>
        )}
        {pattern.example_urls.length > 0 && (
          <div style={{ marginTop: '0.5rem' }}>
            <strong>Example URLs:</strong>
            <ul style={{ margin: '0.25rem 0 0 1.5rem', fontSize: '0.85rem' }}>
              {pattern.example_urls.map((url, index) => (
                <li key={index} style={{ wordBreak: 'break-all' }}>{url}</li>
              ))}
            </ul>
          </div>
        )}
      </div>
    </li>
  );

  return (
    <div className="App">
      <div className="header">
        <h1>HAR Analyzer</h1>
        <p>HTTP Archive Analysis Tool</p>
      </div>

      <div className="container">
        {/* Analysis Controls */}
        <div className="card">
          <h2>Analyze HAR File</h2>
          <div style={{ display: 'flex', gap: '1rem', alignItems: 'center', marginBottom: '1rem' }}>
            <input
              type="text"
              value={filePath}
              onChange={(e) => setFilePath(e.target.value)}
              placeholder="Enter HAR file path"
              style={{
                flex: 1,
                padding: '12px',
                border: '1px solid #ddd',
                borderRadius: '6px',
                fontSize: '1rem'
              }}
            />
            <button
              className="button"
              onClick={analyzeHAR}
              disabled={loading}
            >
              {loading ? 'Analyzing...' : 'Analyze'}
            </button>
          </div>

          {/* Endpoint Analysis Controls */}
          <div style={{ display: 'flex', gap: '1rem', alignItems: 'center', marginBottom: '1rem' }}>
            <select
              value={endpointSortBy}
              onChange={(e) => setEndpointSortBy(e.target.value)}
              style={{
                padding: '12px',
                border: '1px solid #ddd',
                borderRadius: '6px',
                fontSize: '1rem'
              }}
            >
              <option value="requests">Sort by Requests</option>
              <option value="errors">Sort by Errors</option>
              <option value="latency">Sort by Latency</option>
            </select>
            <button
              className="button"
              onClick={analyzeEndpoints}
              disabled={loading}
              style={{ backgroundColor: '#667eea' }}
            >
              {loading ? 'Analyzing...' : 'Analyze Endpoints'}
            </button>
          </div>

          {/* Path Pattern Analysis Controls */}
          <div style={{ display: 'flex', gap: '1rem', alignItems: 'center', marginBottom: '1rem' }}>
            <select
              value={patternSortBy}
              onChange={(e) => setPatternSortBy(e.target.value)}
              style={{
                padding: '12px',
                border: '1px solid #ddd',
                borderRadius: '6px',
                fontSize: '1rem'
              }}
            >
              <option value="requests">Sort by Requests</option>
              <option value="errors">Sort by Errors</option>
              <option value="latency">Sort by Latency</option>
            </select>
            <button
              className="button"
              onClick={analyzePatterns}
              disabled={loading}
              style={{ backgroundColor: '#28a745' }}
            >
              {loading ? 'Analyzing...' : 'Analyze Patterns'}
            </button>
          </div>

          <p style={{ color: '#666', fontSize: '0.9rem' }}>
            Default file: trace.har (329MB) - This may take 5-15 seconds to process
          </p>
        </div>

        {/* Error Display */}
        {error && (
          <div className="error">
            <strong>Error:</strong> {error}
          </div>
        )}

        {/* Loading State */}
        {loading && (
          <div className="loading">
            <h3>Analyzing HAR file...</h3>
            <p>Processing large file, please wait...</p>
          </div>
        )}

        {/* Path Pattern Analysis Results */}
        {patternResults && (
          <div className="card">
            <h2>Path Pattern Analysis ({patternResults.sort_criteria})</h2>
            <p style={{ color: '#666', marginBottom: '1rem' }}>
              Inferred patterns from URLs (like Datadog) - showing {patternResults.returned_patterns} of {patternResults.total_patterns} patterns
            </p>
            <div className="stats-grid">
              <StatCard
                number={patternResults.total_patterns}
                label="Total Patterns"
              />
              <StatCard
                number={patternResults.summary.total_requests}
                label="Total Requests"
              />
              <StatCard
                number={patternResults.summary.avg_success_rate}
                label="Avg Success Rate (%)"
              />
              <StatCard
                number={patternResults.summary.total_4xx_errors}
                label="4xx Errors"
              />
              <StatCard
                number={patternResults.summary.total_5xx_errors}
                label="5xx Errors"
              />
              <StatCard
                number={patternResults.summary.avg_latency}
                label="Avg Latency (ms)"
              />
            </div>

            <h3>Inferred API Patterns</h3>
            <ul className="endpoint-list">
              {patternResults.patterns.map((pattern, index) => (
                <PatternItem key={index} pattern={pattern} />
              ))}
            </ul>
          </div>
        )}

        {/* Endpoint Analysis Results */}
        {endpointResults && (
          <div className="card">
            <h2>Endpoint Analysis ({endpointResults.sort_criteria})</h2>
            <div className="stats-grid">
              <StatCard
                number={endpointResults.total_endpoints}
                label="Total Endpoints"
              />
              <StatCard
                number={endpointResults.summary.total_requests}
                label="Total Requests"
              />
              <StatCard
                number={endpointResults.summary.avg_success_rate}
                label="Avg Success Rate (%)"
              />
              <StatCard
                number={endpointResults.summary.total_4xx_errors}
                label="4xx Errors"
              />
              <StatCard
                number={endpointResults.summary.total_5xx_errors}
                label="5xx Errors"
              />
              <StatCard
                number={endpointResults.summary.avg_latency}
                label="Avg Latency (ms)"
              />
            </div>

            <h3>Top Endpoints (showing {endpointResults.returned_endpoints} of {endpointResults.total_endpoints})</h3>
            <ul className="endpoint-list">
              {endpointResults.endpoints.map((endpoint, index) => (
                <DetailedEndpointItem key={index} endpoint={endpoint} />
              ))}
            </ul>
          </div>
        )}

        {/* Results Display */}
        {results && (
          <>
            {/* Summary Statistics */}
            <div className="card">
              <h2>Summary</h2>
              <div className="stats-grid">
                <StatCard
                  number={results.summary.total_requests}
                  label="Total Requests"
                />
                <StatCard
                  number={results.summary.success_rate}
                  label="Success Rate (%)"
                />
                <StatCard
                  number={results.summary.processing_time_seconds}
                  label="Processing Time (s)"
                />
                <StatCard
                  number={results.summary.processing_rate_entries_per_second}
                  label="Processing Rate (req/s)"
                />
              </div>
            </div>

            {/* Response Codes */}
            <div className="card">
              <h2>HTTP Response Codes</h2>
              <div className="response-codes">
                {Object.entries(results.response_codes)
                  .sort(([,a], [,b]) => b - a)
                  .map(([code, count]) => (
                    <ResponseCodeItem key={code} code={code} count={count} />
                  ))}
              </div>
            </div>

            {/* Error Analysis */}
            {results.error_analysis && results.error_analysis.total_errors > 0 && (
              <div className="card">
                <h2>Error Analysis</h2>
                <div className="stats-grid">
                  <StatCard
                    number={results.error_analysis.total_errors}
                    label="Total Errors"
                  />
                  <StatCard
                    number={results.error_analysis.error_types['4xx'] || 0}
                    label="4xx Errors"
                  />
                  <StatCard
                    number={results.error_analysis.error_types['5xx'] || 0}
                    label="5xx Errors"
                  />
                </div>

                {results.error_analysis.top_error_endpoints.length > 0 && (
                  <div>
                    <h3>Top Error Endpoints</h3>
                    <ul className="endpoint-list">
                      {results.error_analysis.top_error_endpoints.map((endpoint, index) => (
                        <EndpointItem key={index} {...endpoint} />
                      ))}
                    </ul>
                  </div>
                )}
              </div>
            )}

            {/* Latency Analysis */}
            {results.latency_analysis && results.latency_analysis.total_latency_data_points > 0 && (
              <div className="card">
                <h2>Latency Analysis</h2>
                <div className="stats-grid">
                  <StatCard
                    number={results.latency_analysis.avg_latency_ms}
                    label="Average Latency (ms)"
                  />
                  <StatCard
                    number={results.latency_analysis.total_latency_data_points}
                    label="Latency Data Points"
                  />
                </div>

                {Object.keys(results.latency_analysis.percentiles).length > 0 && (
                  <div>
                    <h3>Latency Percentiles</h3>
                    <div className="response-codes">
                      {Object.entries(results.latency_analysis.percentiles).map(([percentile, value]) => (
                        <div key={percentile} className="code-item">
                          <div className="code-number">{percentile.toUpperCase()}</div>
                          <div className="code-count">{Math.round(value)}ms</div>
                        </div>
                      ))}
                    </div>
                  </div>
                )}

                {results.latency_analysis.top_slow_endpoints.length > 0 && (
                  <div>
                    <h3>Slowest Endpoints</h3>
                    <ul className="endpoint-list">
                      {results.latency_analysis.top_slow_endpoints.map((endpoint, index) => (
                        <EndpointItem key={index} {...endpoint} />
                      ))}
                    </ul>
                  </div>
                )}
              </div>
            )}

            {/* Analysis Info */}
            <div className="card">
              <h2>Analysis Information</h2>
              <p><strong>File:</strong> {results.file_path}</p>
              <p><strong>Analyzed at:</strong> {new Date(results.analysis_timestamp).toLocaleString()}</p>
              {results.summary.cached && (
                <div className="success">
                  <strong>Note:</strong> Results served from cache
                </div>
              )}
            </div>
          </>
        )}
      </div>
    </div>
  );
}

export default App;
